import React from "react";
import CircularProgress from "./CircularProgress";
import "./styles.css";

const CalcPercent = () => {
    return (
        <div className="App">
            <CircularProgress
                size={250}
                strokeWidth={10}
                percentage={80}
                color="green"
            />
        </div>
    );
}

export default CalcPercent
